ФК Арсенал Лондон от Sports.ru для iOS – новое приложение о футбольном клубе Arsenal, выступающем в Английской Премьер-Лиге  (АПЛ), позволяет любителям футбола всегда быть в курсе происходящего в любимой команде. 

Приложение об Арсенале включает: 

• Новости, анонсы, тексты лучших спортивных журналистов и интервью об Арсенале; 
• Онлайн трансляции матчей и состав команды; 
• Командную статистику во всех турнирах в режиме реального времени; 
• Календари всех турниров и турнирные таблицы; 
• Блоги и материалы пользователей об Arsenal; 
• Фото и видео; 
• Форумы и чаты для общения с другими болельщиками.
• Освещение всего сезона, включая английский футбол - АПЛ, Кубок Англии и Кубок Лиги, а также еврокубки – Лигу Чемпионов (ЛЧ) и Лигу Европы (ЛЕ).
